import './App.css';
import Header from './components/HeaderComponent/Header';
import Nav from './components/NavComponent/Nav';
import Banner from './components/BannerComponent/Banner'
import Content from './components/ContentComponent/Content';
import About from './components/AboutComponent/About';
import Contact from './components/ContactComponent/Contact';
import Service from './components/ServiceComponent/Service';
import Register from './components/RegisterComponent/Register';
import Login from './components/LoginComponent/Login';
import Logout from './components/LogoutComponent/Logout';
import Adminhome from './components/AdminhomeComponent/Adminhome';
import Manageusers from './components/ManageusersComponent/Manageusers';
import Userhome from './components/UserhomeComponent/Userhome';
import Footer from './components/FooterComponent/Footer';
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <>
      <Header />
      <Nav />
      <Banner />
      <Routes>
        <switch>
        <Route path='/' C={<Content/>}></Route>
        <Route path='/about' C={<About/>}></Route>
        <Route path='/contact' C={<Contact/>}></Route>
        <Route path='/service' C={<Service/>}></Route>
        <Route path='/register' C={<Register/>}></Route>
        <Route path='/login' C={<Login/>}></Route>
        <Route path='/logout' C={<Logout />}></Route>
        <Route path='/admin' C={<Adminhome/>}></Route>
        <Route path='/manageusers' C={<Manageusers/>}></Route>
        <Route path='/user' C={<Userhome/>}></Route>
        </switch>
      </Routes>
      <Footer />




      {/* Back to Top */}
    <a href="#" class="btn btn-lg btn-primary back-to-top"><i class="fa fa-angle-double-up"></i></a>











    </>



  );
}

export default App;
